    body: '{"sql": "\n    select\n    date_trunc(''day'', block_timestamp) as timeframe,\n    sum(case
      when symbol = ''DAI'' then amount_usd end) as DAI,sum(case when symbol = ''USDT''
      then amount_usd end) as USDT,sum(case when symbol = ''BUSD'' then amount_usd
      end) as BUSD,sum(case when symbol = ''USDC'' then amount_usd end) as USDC\n    from  ethereum.udm_events\n    where\n    block_timestamp
      >= ''2020-06-01''\n    -- and amount0_usd > ''0''\n    group by 1\n    order
